import React, {useState} from 'react';

const App = () => {

 const [count, setCount] = useState(10);

return (
    <div>
        <button onClick = { () => setCount(currentCount => currentCount + 1) }>+</button>
        <h1>{count}</h1>
    </div>
    );
}

export default App;
